import React from "react";
import novice from "./images/novice.png";

 function Card() {

    return (
        <div className ="card">
            <img src = {novice} alt = "Loading!" />
        <div className ="card-body">
        <h4 classname = "card-title"> My Title </h4>
        <p className = "card-text text-secondary"> Ssup </p>
        </div>
        </div>
    )
    
 }

 export default Card;
